tDescription\":\"🎥 Super RARE Kenyan Village Feast! » https:\/\/youtu.be\/Ka4e5mEMe10 \\n💗SUPPORT OUR MISSION » http:\/\/bit.ly\/BestEverPatreon  \\n🛵Learn more about Onetrip’s Vietnam tours » http:\/\/bit.ly\/BEFRSOnetrip\\n\\nThanks to Ahmed Habib (@officialomantravels) for showing us the best Omani street food! \\n \\n#BestEverOmanFoodTour #BestEverFoodReviewShow #BEFRS\\n- - - - - - - - - - - - - - - - -\\n» Omani Street Food\\n\\n1.HOOODHOOD: Rakhal + Shark \\u0026 Rice \\nADDRESS: South Athaiba, Muscat, Oman\\nOPEN: 9:00AM – 11:00PM\\n \\n🇴🇲RAKHAL : Mix together wheat flour, salt and water. Let sit for a couple of hours and then use dough to cover flat metal plate.\\n \\n🇴🇲SHARK + RICE: If dry shark, boil until tender and then mixed into a salad. If fresh shark, cut into pieces and then fry with spices and rice.\\n\\n💸PRICE: Rakhal 0.5 USD\/0.19 OMR | Shark \\u0026 Rice 8.00 USD\/3.08 OMR\\n - - - - - - - - - - - - - - - - -\\n2. FOODIES: Orseya + Madhbi\\nADDRESS: Building 368, Block 333, Al Khoudh Street, Muscat.\\nOPEN: 9:00AM - 11:00PM\\n \\n🍛ORSEYA: Cook lamb for 5 hours and then add rice and ghee. Mash the mixture with a bit of salt, cumin, cardamom, cinnamon and white pepper powder.\\n \\n🍗 MADHBI : Season chicken with Omani spices and the other meats with salt and pepper. Place the meats on rocks above a bed of coal or fire. \\n \\n💸PRICE: Orseya 6.00 USD\/2.31OMR per plate \\u0026 25.00 USD\/9.62 OMR per giant plate  | Mathbi 5.00 USD\/1.92 OMR per plate\\n- - - - - - - - - - - - - - - - -\\n3. YAQOOB SALEH MOHAMMED AL OBEDANI OMANI HALWA FACTORY: Halwa\\nADDRESS: Nakhal, near Nakhal Fort\\nOPEN: 7:00AM – 10:00PM\\n \\n🍭HALWA: Add sugar, an egg and starch into a pot of boiling water. Mix over heat for 2-3 hours.\\n\\n💸PRICE: 10.00 - 20.00 USD\/3.85 - 7.70 OMR per kg \\n- - - - - - - - - - - - - - - - -\\n4. FAYROOZ CAFE: Chicken Shawarma with Chips Oman\\nADDRESS: Madinat Sultan Qaboos\\nOPEN: 10:00AM – 12:00PM\\n \\n🍗CHICKEN SHAWARMA WITH CHIPS OMAN: Place the chicken breast between two cling films and beat to make it thin. Marinate with plain yoghurt, cardamom, chopped garlic, lime juice salt and pepper then roast. Place chicken between Arabic bread then serve with Chips Oman. \\n\\n💸PRICE: 2.00 USD\/0.77 OMR\\n- - - - - - - - - - - - - - - - -\\n💬COME SAY HI:\\nINSTAGRAM » http:\/\/bit.ly\/BestEverInstagram (@besteverfoodreviewshow)\\nFACEBOOK » http:\/\/bit.ly\/BEFRSFacebook\\n\\n💗SUPPORT OUR MISSION:\\nPatreon is a platform that allows people to support creators on a recurring basis. Your contribution is an investment in the creative freedom of my channel and enables me to keep my content authentic and uninterrupted. Your generous donation allows me the time and resources to create more videos for you. We also have some pretty sweet rewards, exclusive to Patreon Bestys. » http:\/\/bit.ly\/BestEverPatreon\\n\\n🥒ABOUT BEFRS:\\nHey, I’m Sonny! I’m from the US but currently call Vietnam home. I’ve been living in Asia for 10 years and started making food and travel videos to document my experiences. People either enjoyed my undeniable charm or enjoyed watching me eat things like coconut worms, and thus Best Ever Food Review Show came to be.\\n\\nI travel to different parts of the world, hunting down and documenting the most unique food each country has to offer. If you see any factual food errors in my videos, please feel free to politely let me know in the comments. I'm a huge fan of trying different, interesting foods in each country. My show is from a Western point of view, but more importantly, MY point of view. It is not meant to offend any person or culture.\\n\\nDon’t forget to subscribe to Best Ever Food Review Show, so we can connect through food and travel and become Bestys!\\n- - - - - - - - - - - - - - - - -\\n🎬CREDITS:\\nDIRECTOR OF PHOTOGRAPHY » Bret Hamilton\\nCAMERA OPERATOR » Nguyễn Tân Khải\\nVIDEO EDITOR » Sonny Side\\nCOLOR \\u0026 MASTER » Quí Nguyễn\\nPRODUCER » Liz Peterson\\n\\nFor busine RESS: South Athaiba, Muscat, Oman\\nOPEN: 9:00AM – 11:00PM\\n \\n🇴🇲RAKHAL : Mix together wheat flour, salt and water. Let sit for a couple of hours and then use dough to cover flat metal plate.\\n \\n🇴🇲SHARK + RICE: If dry shark, boil until tender and then mixed into a salad. If fresh shark, cut into pieces and then fry with spices and rice.\\n\\n💸PRICE: Rakhal 0.5 USD\/0.19 OMR | Shark \\u0026 Rice 8.00 USD\/3.08 OMR\\n - - - - - - - - - - - - - - - - -\\n2. FOODIES: Orseya + Madhbi\\nADDRESS: Building 368, Block 333, Al Khoudh Street, Muscat.\\nOPEN: 9:00AM - 11:00PM\\n \\n🍛ORSEYA: Cook lamb for 5 hours and then add rice and ghee. Mash the mixture with a bit of salt, cumin, cardamom, cinnamon and white pepper powder.\\n \\n🍗 MADHBI : Season chicken with Omani spices and the other meats with salt and pepper. Place the meats on rocks above a bed of coal or fire. \\n \\n💸PRICE: Orseya 6.00 USD\/2.31OMR per plate \\u0026 25.00 USD\/9.62 OMR per giant plate  | Mathbi 5.00 USD\/1.92 OMR per plate\\n- - - - - - - - - - - - - - - - -\\n3. YAQOOB SALEH MOHAMMED AL OBEDANI OMANI HALWA FACTORY: Halwa\\nADDRESS: Nakhal, near Nakhal Fort\\nOPEN: 7:00AM – 10:00PM\\n \\n🍭HALWA: Add sugar, an egg and starch into a pot of boiling water. Mix over heat for 2-3 hours.\\n\\n💸PRICE: 10.00 - 20.00 USD\/3.85 - 7.70 OMR per kg \\n- - - - - - - - - - - - - - - - -\\n4. FAYROOZ CAFE: Chicken Shawarma with Chips Oman\\nADDRESS: Madinat Sultan Qaboos\\nOPEN: 10:00AM – 12:00PM\\n \\n🍗CHICKEN SHAWARMA WITH CHIPS OMAN: Place the chicken breast between two cling films and beat to make it thin. Marinate with plain yoghurt, cardamom, chopped garlic, lime juice salt and pepper then roast. Place chicken between Arabic bread then serve with Chips Oman. \\n\\n💸PRICE: 2.00 USD\/0.77 OMR\\n- - - - - - - - - - - - - - - - -\\n💬COME SAY HI:\\nINSTAGRAM » http:\/\/bit.ly\/BestEverInstagram (@besteverfoodreviewshow)\\nFACEBOOK » http:\/\/bit.ly\/BEFRSFacebook\\n\\n💗SUPPORT OUR MISSION:\\nPatreon is a platform that allows people to support creators on a recurring basis. Your contribution is an investment in the creative freedom of my channel and enables me to keep my content authentic and uninterrupted. Your generous donation allows me the time and resources to create more videos for you. We also have some pretty sweet rewards, exclusive to Patreon Bestys. » http:\/\/bit.ly\/BestEverPatreon\\n\\n🥒ABOUT BEFRS:\\nHey, I’m Sonny! I’m from the US but currently call Vietnam home. I’ve been living in Asia for 10 years and started making food and travel videos to document my experiences. People either enjoyed my undeniable charm or enjoyed watching me eat things like coconut worms, and thus Best Ever Food Review Show came to be.\\n\\nI travel to different parts of the world, hunting down and documenting the most unique food each country has to offer. If you see any factual food errors in my videos, please feel free to politely let me know in the comments. I'm a huge fan of trying different, interesting foods in each country. My show is from a Western point of view, but more importantly, MY point of view. It is not meant to offend any person or culture.\\n\\nDon’t forget to subscribe to Best Ever Food Review Show, so we can connect through food and travel and become Bestys!\\n- - - - - - - - - - - - - - - - -\\n🎬CREDITS:\\nDIRECTOR OF PHOTOGRAPHY » Bret Hamilton\\nCAMERA OPERATOR » Nguyễn Tân Khải\\nVIDEO EDITOR » Sonny Side\\nCOLOR \\u0026 MASTER » Quí Nguyễn\\nPRODUCER » Liz Peterson\\n\\nFor business inquiries, please email: team.befrs@gmail.com\"},\"lengthSeconds\":\"1305\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/user\/sonnysidevideos\",\"externalChannelId\":\"UCcAd5Np7fO8SeejB1FVKcYw\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\", edirect?v=EPggj6MZNm8\u0026event=video_description\u0026redir_token=5Uil2XXiJ_ljGko04ZCMxkx1NaV8MTU5MjgzMjA3N0AxNTkyNzQ1Njc3\u0026q=http%3A%2F%2Fbit.ly%2FBEFRSOnetrip","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\nThanks to Ahmed Habib (@officialomantravels) for showing us the best Omani street food! \n \n"},{"text":"#BestEverOmanFoodTour","navigationEndpoint":{"clickTrackingParams":"CJ0BENzXBCITCOzjo4KAk-oCFQKHVQodBusBNg==","commandMetadata":{"webCommandMetadata":{"url":"/results?search_query=%23BestEverOmanFoodTour","webPageType":"WEB_PAGE_TYPE_SEARCH","rootVe":4724}},"searchEndpoint":{"query":"#BestEverOmanFoodTour"}},"loggingDirectives":{"trackingParams":"CJ0BENzXBCITCOzjo4KAk-oCFQKHVQodBusBNg==","visibility":{"types":"12"}}},{"text":" "},{"text":"#BestEverFoodReviewShow","navigationEndpoint":{"clickTrackingParams":"CJwBENzXBCITCOzjo4KAk-oCFQKHVQodBusBNg==","commandMetadata":{"webCommandMetadata":{"url":"/results?search_query=%23BestEverFoodReviewShow","webPageType":"WEB_PAGE_TYPE_SEARCH","rootVe":4724}},"searchEndpoint":{"query":"#BestEverFoodReviewShow"}},"loggingDirectives":{"trackingParams":"CJwBENzXBCITCOzjo4KAk-oCFQKHVQodBusBNg==","visibility":{"types":"12"}}},{"text":" "},{"text":"#BEFRS","navigationEndpoint":{"clickTrackingParams":"CJsBENzXBCITCOzjo4KAk-oCFQKHVQodBusBNg==","commandMetadata":{"webCommandMetadata":{"url":"/results?search_query=%23BEFRS","webPageType":"WEB_PAGE_TYPE_SEARCH","rootVe":4724}},"searchEndpoint":{"query":"#BEFRS"}},"loggingDirectives":{"trackingParams":"CJsBENzXBCITCOzjo4KAk-oCFQKHVQodBusBNg==","visibility":{"types":"12"}}},{"text":"\n- - - - - - - - - - - - - - - - -\n» Omani Street Food\n\n1.HOOODHOOD: Rakhal + Shark \u0026 Rice \nADDRESS: South Athaiba, Muscat, Oman\nOPEN: 9:00AM – 11:00PM\n \n🇴🇲RAKHAL : Mix together wheat flour, salt and water. Let sit for a couple of hours and then use dough to cover flat metal plate.\n \n🇴🇲SHARK + RICE: If dry shark, boil until tender and then mixed into a salad. If fresh shark, cut into pieces and then fry with spices and rice.\n\n💸PRICE: Rakhal 0.5 USD/0.19 OMR | Shark \u0026 Rice 8.00 USD/3.08 OMR\n - - - - - - - - - - - - - - - - -\n2. FOODIES: Orseya + Madhbi\nADDRESS: Building 368, Block 333, Al Khoudh Street, Muscat.\nOPEN: 9:00AM - 11:00PM\n \n🍛ORSEYA: Cook lamb for 5 hours and then add rice and ghee. Mash the mixture with a bit of salt, cumin, cardamom, cinnamon and white pepper powder.\n \n🍗 MADHBI : Season chicken with Omani spices and the other meats with salt and pepper. Place the meats on rocks above a bed of coal or fire. \n \n💸PRICE: Orseya 6.00 USD/2.31OMR per plate \u0026 25.00 USD/9.62 OMR per giant plate  | Mathbi 5.00 USD/1.92 OMR per plate\n- - - - - - - - - - - - - - - - -\n3. YAQOOB SALEH MOHAMMED AL OBEDANI OMANI HALWA FACTORY: Halwa\nADDRESS: Nakhal, near Nakhal Fort\nOPEN: 7:00AM – 10:00PM\n \n🍭HALWA: Add sugar, an egg and starch into a pot of boiling water. Mix over heat for 2-3 hours.\n\n💸PRICE: 10.00 - 20.00 USD/3.85 - 7.70 OMR per kg \n- - - - - - - - - - - - - - - - -\n4. FAYROOZ CAFE: Chicken Shawarma with Chips Oman\nADDRESS: Madinat Sultan Qaboos\nOPEN: 10:00AM – 12:00PM\n \n🍗CHICKEN SHAWARMA WITH CHIPS OMAN: Place the chicken breast between two cling films and beat to make it thin. Marinate with plain yoghurt, cardamom, chopped garlic, lime juice salt and pepper then roast. Place chicken between Arabic bread then serve with Chips Oman. \n\n💸PRICE: 2.00 USD/0.77 OMR\n- - - - - - - - - - - - - - - - -\n💬COME SAY HI:\nINSTAGRAM » "},{"text":"http://bit.ly/BestEverInstagram","navigationEndpoint":{"clickTrackingParams":"CJgBEM2rARgBIhMI7OOjgoCT6gIVAodVCh0G6wE2SO_s5Jj6kYj8EA==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?v=EPggj6MZNm8\u0026event=video_description\u0026redir_token=5Uil2XXiJ_ljGko04ZCMxkx1NaV8MTU5MjgzMjA3N0AxNTkyNzQ1Njc3\u0026q=http%3A%2F%2Fbit.ly%2FBestEverInstagram","rootVe":83769}},"urlEndpoint":{"url":"/redirect?v=EPggj6MZNm8\u0026event=video_description\u0026redir_token=5Ui d making food and travel videos to document my experiences. People either enjoyed my undeniable charm or enjoyed watching me eat things like coconut worms, and thus Best Ever Food Review Show came to be.\n\nI travel to different parts of the world, hunting down and documenting the most unique food each country has to offer. If you see any factual food errors in my videos, please feel free to politely let me know in the comments. I'm a huge fan of trying different, interesting foods in each country. My show is from a Western point of view, but more importantly, MY point of view. It is not meant to offend any person or culture.\n\nDon’t forget to subscribe to Best Ever Food Review Show, so we can connect through food and travel and become Bestys!\n- - - - - - - - - - - - - - - - -\n🎬CREDITS:\nDIRECTOR OF PHOTOGRAPHY » Bret Hamilton\nCAMERA OPERATOR » Nguyễn Tân Khải\nVIDEO EDITOR » Sonny Side\nCOLOR \u0026 MASTER » Quí Nguyễn\nPRODUCER » Liz Peterson\n\nFor business inquiries, please email: team.befrs@gmail.com"}]},"subscribeButton":{"buttonRenderer":{"style":"STYLE_DESTRUCTIVE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Subscribe"}]},"navigationEndpoint":{"clickTrackingParams":"CJkBEJsrIhMI7OOjgoCT6gIVAodVCh0G6wE2","commandMetadata":{"webCommandMetadata":{"ignoreNavigation":true}},"modalEndpoint":{"modal":{"modalWithTitleAndButtonRenderer":{"title":{"simpleText":"Want to subscribe to this channel?"},"content":{"simpleText":"Sign in to subscribe to this channel."},"button":{"buttonRenderer":{"style":"STYLE_BLUE_TEXT","size":"SIZE_DEFAULT","isDisabled":false,"text":{"simpleText":"Sign in"},"navigationEndpoint":{"clickTrackingParams":"CJoBEP2GBCITCOzjo4KAk-oCFQKHVQodBusBNjIJc3Vic2NyaWJl","commandMetadata":{"webCommandMetadata":{"url":"https://accounts.google.com/ServiceLogin?service=youtube\u0026uilel=3\u0026passive=true\u0026continue=https%3A%2F%2Fwww.youtube.com%2Fsignin%3Faction_handle_signin%3Dtrue%26app%3Ddesktop%26hl%3Den%26next%3D%252Fwatch ageName":{"simpleText":"Yiddish"}},{"languageCode":"yo","languageName":{"simpleText":"Yoruba"}},{"languageCode":"zu","languageName":{"simpleText":"Zulu"}}],"defaultAudioTrackIndex":0,"contribute":{"captionsMetadataRenderer":{"addSubtitlesText":{"runs":[{"text":"Add subtitles/CC","navigationEndpoint":{"clickTrackingParams":"CAAQu2kiEwiF7aOCgJPqAhWc61UKHdAjBS8=","commandMetadata":{"webCommandMetadata":{"url":"/timedtext_video?ref=watch\u0026v=EPggj6MZNm8","rootVe":83769}},"urlEndpoint":{"url":"/timedtext_video?ref=watch\u0026v=EPggj6MZNm8"}}}]},"noSubtitlesText":{"simpleText":"This video doesn't have subtitles or closed captions yet."},"promoSubtitlesText":{"simpleText":"Help this video reach more people by contributing subtitles or closed captions in a language you speak."}}}}},"videoDetails":{"videoId":"EPggj6MZNm8","title":"Most UNIQUE Middle Eastern Street Food in the GCC!!! ULTIMATE Omani Street Food Tour in Muscat!!!","lengthSeconds":"1305","keywords":["oman","oman travel","oman food","oman street food","omani street food","oman chips","oman chip sandwich","best ever food review show","middle east food","middle eastern food","gcc food","gcc travel","oman safe","muscat","muscat food","where to eat muscat","muscat street food"],"channelId":"UCcAd5Np7fO8SeejB1FVKcYw","isOwnerViewing":false,"shortDescription":"🎥 Super RARE Kenyan Village Feast! » https://youtu.be/Ka4e5mEMe10 \n💗SUPPORT OUR MISSION » http://bit.ly/BestEverPatreon  \n🛵Learn more about Onetrip’s Vietnam tours » http://bit.ly/BEFRSOnetrip\n\nThanks to Ahmed Habib (@officialomantravels) for showing us the best Omani street food! \n \n#BestEverOmanFoodTour #BestEverFoodReviewShow #BEFRS\n- - - - - - - - - - - - - - - - -\n» Omani Street Food\n\n1.HOOODHOOD: Rakhal + Shark \u0026 Rice \nADDRESS: South Athaiba, Muscat, Oman\nOPEN: 9:00AM – 11:00PM\n \n🇴🇲RAKHAL : Mix together wheat flour, salt and water. Let sit for a couple of hours and then use dough to cover flat metal plate.\n \n🇴🇲SHARK + RICE: If dry shark, boil until tender and then mixed into a salad. If fresh shark, cut into pieces and then fry with spices and rice.\n\n💸PRICE: Rakhal 0.5 USD/0.19 OMR | Shark \u0026 Rice 8.00 USD/3.08 OMR\n - - - - - - - - - - - - - - - - -\n2. FOODIES: Orseya + Madhbi\nADDRESS: Building 368, Block 333, Al Khoudh Street, Muscat.\nOPEN: 9:00AM - 11:00PM\n \n🍛ORSEYA: Cook lamb for 5 hours and then add rice and ghee. Mash the mixture with a bit of salt, cumin, cardamom, cinnamon and white pepper powder.\n \n🍗 MADHBI : Season chicken with Omani spices and the other meats with salt and pepper. Place the meats on rocks above a bed of coal or fire. \n \n💸PRICE: Orseya 6.00 USD/2.31OMR per plate \u0026 25.00 USD/9.62 OMR per giant plate  | Mathbi 5.00 USD/1.92 OMR per plate\n- - - - - - - - - - - - - - - - -\n3. YAQOOB SALEH MOHAMMED AL OBEDANI OMANI HALWA FACTORY: Halwa\nADDRESS: Nakhal, near Nakhal Fort\nOPEN: 7:00AM – 10:00PM\n \n🍭HALWA: Add sugar, an egg and starch into a pot of boiling water. Mix over heat for 2-3 hours.\n\n💸PRICE: 10.00 - 20.00 USD/3.85 - 7.70 OMR per kg \n- - - - - - - - - - - - - - - - -\n4. FAYROOZ CAFE: Chicken Shawarma with Chips Oman\nADDRESS: Madinat Sultan Qaboos\nOPEN: 10:00AM – 12:00PM\n \n🍗CHICKEN SHAWARMA WITH CHIPS OMAN: Place the chicken breast between two cling films and beat to make it thin. Marinate with plain yoghurt, cardamom, chopped garlic, lime juice salt and pepper then roast. Place chicken between Arabic bread then serve with Chips Oman. \n\n💸PRICE: 2.00 USD/0.77 OMR\n- - - - - - - - - - - - - - - - -\n💬COME SAY HI:\nINSTAGRAM » http://bit.ly/BestEverInstagram (@besteverfoodreviewshow)\nFACEBOOK » http://bit.ly/BEFRSFacebook\n\n💗SUPPORT OUR MISSION:\nPatreon is a platform that allows people to support creators on a recurring basis. Your contribution is an investment in the creative freedom of my channel and enables me to keep my content authentic and uninterrupted. Your generous donation allows me the time and resources to create more videos for you. We also have some pretty sweet rewards, exclusive to Patreon Bestys. » http://bit.ly/BestEverPatreon\n\n🥒ABOUT BEFRS:\nHey, I’m Sonny! I’m from the US but currently call Vietnam home. I’ve been living in Asia for 10 years and started making food and travel videos to document my experiences. People either enjoyed my undeniable charm or enjoyed watching me eat things like coconut worms, and thus Best Ever Food Review Show came to be.\n\nI travel to different parts of the world, hunting down and documenting the most unique food each country has to offer. If you see any factual food errors in my videos, please feel free to politely let me know in the comments. I'm a huge fan of trying different, interesting foods in each country. My show is from a Western point of view, but more importantly, MY point of view. It is not meant to offend any person or culture.\n\nDon’t forget to subscribe to Best Ever Food Review Show, so we can connect through food and travel and become Bestys!\n- - - - - - - - - - - - - - - - -\n🎬CREDITS:\nDIRECTOR OF PHOTOGRAPHY » Bret Hamilton\nCAMERA OPERATOR » Nguyễn Tân Khải\nVIDEO EDITOR » Sonny Side\nCOLOR \u0026 MASTER » Quí Nguyễn\nPRODUCER » Liz Peterson\n\nFor business inquiries, please email: team.befrs@gmail.com","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/EPggj6MZNm8/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDNkeA-9j5_5IlAxWUs4NBAI3eocg","width":168,"height":94},{"url":"https://i.ytimg.com/vi/EPggj6MZNm8/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLBwkCJNVaoDJBAeTpdIsvUhPfH3zw","width":196,"height":110},{"url":"https://i.ytimg.com/vi/EPggj6MZNm8/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLDCgf_F9uEMg9lVRV1vF7nBOnZ2RQ","width":246,"height":138},{"url":"https://i.ytimg.com/vi/EPggj6MZNm8/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u002
